// Quiz.js
// 퀴즈 페이지
import React from 'react';

const Quiz = () => {
  return (
    <div className="quiz">
      <h1>퀴즈 페이지</h1>
      <p>퀴즈 페이지 구현</p>
    </div>
  );
};

export default Quiz;
